Created attachment 85981 Screenshot of Apply Patch dialog showing conflict
Build ID: M20071023-1652
Steps To Reproduce: 1. Create a new class called Test with the following contents: (the comment simply says "I am a German comment. I may even contain umlauts, e. g. 'ä'") --------- public class Test {
/* Ich bin ein deutscher Kommentar. * Ich darf sogar Umlaute enthalten, wie zum * Beispiel "ä". */
private int dummy = 0;
} ---------
2. Commit to CVS 3. Change the value of the dummy variable to 1. 4. Select Team->Create Patch and leave the defaults (clipboard) 5. Restore from CVS 6. Select Team->Apply Patch from clipboard
Eclipse will report an unmatching patch, because the German umlaut "ä" was not correctly put into the diff output, but replaced with a question mark.
This is of course not limited to block comments.
I have attached a screenshot of the conflict view.
